  const value = useContext(ThemeContext)
  return (
    <div style={{ padding: 35 }} className="App">
      <h1>App Hello World</h1>
      <Button variant="contained" onClick={value.handleSetTheme}>
        HANDLE
      </Button>
    </div>
  )
}
export default App
